const style = {
    paper: {
        marginTop: 8,
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
    },
    form: {
        width: "100%",
        marginTop: 20
    },
    submit: {
        marginTop: 15
    },
    avatar: {
        margin: 5,
        backgroundColor: "#",
        width: 60,
        height: 60
    },
    icon: {
        fontSize: 40
    }

}

export default style
